import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './MainPage.css'; // CSS 파일 import

const MainPage: React.FC = () => {
    const [data, setData] = useState<any>(null);
    const [searchQuery, setSearchQuery] = useState(''); // 검색어 상태
    const [searchResults, setSearchResults] = useState<any[]>([]); // 검색 결과 상태

    useEffect(() => {
        axios.get('/main')
            .then((response) => {
                console.log(response.data);
                setData(response.data);
            })
            .catch((error) => {
                console.error('백엔드에서 데이터 가져오기 오류:', error);
            });
    }, []);

    // 검색 처리 함수
    const onSearch = () => {
        if (searchQuery.trim() === '') {
            setSearchResults([]);
            return;
        }

        axios.get(`/api/search?query=${searchQuery}`)
            .then((response) => {
                setSearchResults(response.data);
            })
            .catch((error) => {
                console.error('검색 오류:', error);
            });
    };

    if (!data) {
        return <p>로딩 중...</p>;
    }

    return (
        <div className="main-page">
            <h1>버튜버 노래</h1>

            {/* 검색창 추가 */}
            <div>
                <input
                    type="text"
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                    placeholder="검색어를 입력하세요"
                />
                <button onClick={onSearch}>검색</button>
            </div>

            {/* 검색 결과 섹션 */}
            {searchResults.length > 0 && (
                <>
                    <h2>검색 결과</h2>
                    <div className="video-grid">
                        {searchResults.map((song: any) => (
                            <VideoCard key={song.id} song={song} />
                        ))}
                    </div>
                </>
            )}

            {/* 랜덤 노래 섹션 */}
            <h2>랜덤 노래</h2>
            <div className="video-grid">
                {data.randomSongs.map((song: any) => (
                    <VideoCard key={song.id} song={song} />
                ))}
            </div>

            {/* 주간 인기 노래 섹션 */}
            <h2>주간 인기 노래</h2>
            <div className="video-grid">
                {data.top10WeeklySongs.map((song: any) => (
                    <VideoCard key={song.id} song={song} />
                ))}
            </div>

            {/* 일간 인기 노래 섹션 */}
            <h2>일간 인기 노래</h2>
            <div className="video-grid">
                {data.top10DailySongs.map((song: any) => (
                    <VideoCard key={song.id} song={song} />
                ))}
            </div>

            {/* 최신 노래 섹션 */}
            <h2>최신 노래</h2>
            <div className="video-grid">
                {data.top10RecentSongs.map((song: any) => (
                    <VideoCard key={song.id} song={song} />
                ))}
            </div>
        </div>
    );
};

// 각 노래 정보를 표시하는 VideoCard 컴포넌트
const VideoCard: React.FC<{ song: any }> = ({ song }) => {
    const thumbnailUrl = `https://img.youtube.com/vi/${song.videoId}/0.jpg`; // YouTube 썸네일 URL 형식

    const handleCardClick = () => {
        window.open(`https://www.youtube.com/watch?v=${song.videoId}`, '_blank');
    };

    return (
        <div className="video-card" onClick={handleCardClick}>
            <img src={thumbnailUrl} alt={song.title} className="thumbnail" />
            <div className="video-info">
                <h3>{song.title}</h3>
                <p>채널명: {song.vtuberName}</p>
                <p>게시일: {new Date(song.publishedAt).toLocaleDateString()}</p>
                <p>조회수: {song.viewCount.toLocaleString()}</p>
            </div>
        </div>
    );
};

export default MainPage;
